import Header from "./Header";
import {Link} from 'react-router-dom';

function Login(){
    
    const [username,setusername]= useState('');
    const [password,setpassword]= useState('');
    return (
        <div>
            <Header/>
            Welcome to Login page
            <br></br>
            USERNAME
            <input type="text" />
            <br></br>
            PASSWORD
            <br></br>
            <input type="password"/>
            <br></br>
            <button >LOGIN</button>
            <Link to="/signup">SIGNUP</Link>
        </div>
    )
}
export default Login;
